DELIMITER $$
--
-- Funciones
--
CREATE DEFINER=`nviame_app`@`%` FUNCTION `shipments_available_shipments` (`id_shipment` INT) RETURNS INT(11) BEGIN
	DECLARE quantity INT DEFAULT NULL;
	DECLARE settings_max_offers INT DEFAULT 0;
	DECLARE current_offers INT DEFAULT 0;
	
	SELECT users_settings.shipments_max_offers INTO settings_max_offers FROM shipments INNER JOIN users_settings ON shipments.id_user = users_settings.user_id WHERE shipments.id = id_shipment;
	
	IF settings_max_offers IS NULL OR settings_max_offers < 1 THEN
		RETURN NULL;
	END IF;
	
	SELECT COUNT(*) INTO current_offers FROM shipments INNER JOIN shipments_offers ON shipments.id = shipments_offers.id_shipment WHERE shipments.id = id_shipment;
	
	SET quantity = settings_max_offers - current_offers;
	
	RETURN quantity;
END$$

CREATE DEFINER=`nviame_app`@`%` FUNCTION `shipments_is_available` (`id_shipment` INT, `id_user` INT) RETURNS INT(11) BEGIN
	DECLARE o INT DEFAULT 0;
	
	SELECT COUNT(*) INTO o FROM shipments INNER JOIN shipments_offers ON shipments.id = shipments_offers.id_shipment WHERE shipments.id = id_shipment AND shipments_offers.id_user = id_user;
	
	RETURN IF(o > 0, 0, 1);
END$$

CREATE DEFINER=`nviame_app`@`%` FUNCTION `shipment_is_expired` (`id` INT) RETURNS TINYINT(1) BEGIN
	DECLARE val INT DEFAULT NULL;
	DECLARE res TINYINT DEFAULT 0;
	SELECT 
		s.id 
	INTO 
		val
	FROM
		shipments AS s
	WHERE 
		s.id = id AND s.id_status IS NULL AND s.max_arrival_date IS NOT NULL AND CURDATE() > DATE(max_arrival_date);
		
	IF val IS NOT NULL THEN
		SET res = 1;
	END IF; 
	
	RETURN res;
END$$

CREATE DEFINER=`nviame_app`@`%` FUNCTION `user_overall_rating` (`id_user` INT) RETURNS INT(11) BEGIN
	DECLARE rating INT DEFAULT 0;
	SELECT overall_rating INTO rating FROM users WHERE id = id_user;
	RETURN rating;
END$$

DELIMITER ;

